import React, {Fragment, useState} from "react";
import styles from "./LandingPage.module.css";
import AboutMe from "../About Me/AboutMe";

const LandingPage = () => {


    return(
    <Fragment>
        <div className={styles.container}>


        <div className ={`${styles.darkDiv} + flex`}>
            <h2 className={styles.aboutText}>HELLO!  </h2>
            <p className={styles.aboutText}>My name is Jacek Hacking and I am a fullstack web developer with an emphasis on Front-End web development. </p>
        </div>
        <div className = {styles.selfieDiv}>

        </div>
            <AboutMe/>
        </div>

    </Fragment>
    )
}

export default LandingPage
